import React from 'react';
import s from './ProfileStatus.module.css';


const ProfileStatus = (props) => {
    return (
        <>
            <div className={s.haha}>
                <div>Мой статус</div>
                <span>{props.status}</span>
            </div>
            <div>
                <input value={props.status}/>
            </div>
        </>
    )
}

export default ProfileStatus;
